import React, { Component } from 'react';
import JustifiedGrid from 'react-justified-grid';

class Gallery extends Component {
  render() {
    return (
      <div
        style={{
          display: 'block',
          minHeight: '1px',
          width: '100%',
          border: '1px solid #ddd',
          overflow: 'auto',
          textAlign: 'center',
          background: 'white',
        }}
      >
        <JustifiedGrid
          images={imageList}
          rows={3}
          maxRowHeight={64}
          gutter={1}
        />
      </div>
    );
  }
}

export interface Image {
  src: string;
  alt: string;
  width: number;
  height: number;
}

const imageList: Image[] = [
  {
    src: 'http://i1.ytimg.com/vi/VK4ah66jBvE/0.jpg',
